import React from "react";
import Logo from "../Logo";
import SearchBar from "../SearchBar";
import ProfileButton from "../ProfileButton";
import "./Header.css"

const Header = () => {
    return (
        <header className="main-header">
            <Logo />
            <SearchBar />
            <ProfileButton />
        </header>
    );
};

export default Header;
